"    <div id=\"topicTitle\">",
"     Patient information: Ventricular fibrillation (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/ventricular-fibrillation-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H1139495841\">",
"      <span class=\"h1\">",
"       What is ventricular fibrillation?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Ventricular fibrillation is a heart problem that causes death if it isn&rsquo;t treated within minutes. Another term for ventricular fibrillation is &ldquo;V-fib.&rdquo;",
"     </p>",
"     <p>",
"      In V-fib, the electrical signals that control the heartbeat become abnormal. As a result, the bottom chambers of the heart (ventricles) twitch, but do not pump blood (",
"      <a class=\"graphic graphic_figure graphicRef56936 \" href=\"UTD.htm?9/42/9888\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      When the heart suddenly stops beating and pumping blood, doctors call it &ldquo;sudden cardiac arrest.&rdquo; Sudden cardiac arrest is a medical emergency that needs to be treated right away. If it isn&rsquo;t, it causes death. But even with treatment, most people with sudden cardiac arrest do not survive.",
"     </p>",
"     <p>",
"      V-fib is the abnormal heart rhythm that most commonly causes sudden cardiac arrest.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1139495873\">",
"      <span class=\"h1\">",
"       What causes ventricular fibrillation?",
"      </span>",
"      &nbsp;&mdash;&nbsp;V-fib can happen in people with many different conditions. But the most common cause of V-fib is a heart attack. In a heart attack, 1 of the arteries that brings blood to the heart gets blocked, and heart muscle dies. V-fib usually happens within a few days of a heart attack. But sometimes, V-fib is the first sign of a heart attack.",
"     </p>",
"     <p>",
"      V-fib can happen in people who have other types of heart problems. It can also happen in people who do not have a heart problem. For example, it can happen in people who have certain lung problems or a severe injury, or use illegal drugs.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1139495888\">",
"      <span class=\"h1\">",
"       What are the symptoms of ventricular fibrillation?",
"      </span>",
"      &nbsp;&mdash;&nbsp;V-fib causes people to collapse and pass out, and have no pulse or heartbeat.",
"     </p>",
"     <p>",
"      To check for V-fib, a doctor or emergency worker will do an electrocardiogram (called an &ldquo;ECG&rdquo; or &ldquo;EKG&rdquo;). This test measures the electrical activity in the heart.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1139495903\">",
"      <span class=\"h1\">",
"       How is ventricular fibrillation treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;V-fib needs to be treated right away. The only way to stop V-fib is a treatment called &ldquo;defibrillation.&rdquo; This involves using a device to send an electrical shock to the heart. This shock can sometimes get a normal heart rhythm started again. Defibrillation has the best chance of working when it is done right away.",
"     </p>",
"     <p>",
"      V-fib is also usually treated with CPR. CPR is a way to get blood and oxygen moving through the body of someone whose heart has stopped beating. It involves &ldquo;compressions,&rdquo; which is when another person presses hard and fast (over and over again) on a person&rsquo;s chest. This squeezes the heart and gets the blood moving again, although not as well as when the heart pumps blood on its own.",
"     </p>",
"     <p>",
"      If these treatments are done within a few minutes of when V-fib starts, they sometimes work to restart the heart. After the heart is beating again and blood is flowing through the body, people have other tests and treatments.",
"     </p>",
"     <p>",
"      The doctor will do tests to figure out what&rsquo;s causing the V-fib. He or she will treat any causes of V-fib that can be treated.",
"     </p>",
"     <p>",
"      Other treatments, including long-term treatments, after an episode of V-fib can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medicines that help change the heart rhythm back to normal, or control the speed or rhythm of the heartbeat",
"       </li>",
"       <li>",
"        An implantable cardioverter-defibrillator (called an &ldquo;ICD&rdquo;) &ndash; An ICD is a device that is put under a person&rsquo;s skin near his or her heart. It can sense abnormal heartbeats and then treat them with an electrical shock. Most people with V-fib are treated with an ICD.",
"       </li>",
"       <li>",
"        A procedure called &ldquo;ablation&rdquo; &ndash; During this procedure, the doctor uses heat or cold to destroy the small part of the heart that is sending the abnormal electrical signals. This is usually done only if people have many episodes of V-fib.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1139495918\">",
"      <span class=\"h1\">",
"       What will my life be like if I survive?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It depends, in part, on what caused your V-fib and how quickly it was treated. After V-fib and sudden cardiac arrest, some people recover completely without any long-term problems. But many survivors have long-term brain problems.",
"     </p>",
