"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?39/16/40195?source=related_link\">",
"      Patient information: Heart attack (Beyond the Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_basics\" href=\"UTD.htm?9/53/10068?source=related_link\">",
"      Patient information: Heart attack (The Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?11/20/11589?source=related_link\">",
"      Patient information: Implantable cardioverter-defibrillators (Beyond the Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_basics\" href=\"UTD.htm?37/60/38850?source=related_link\">",
"      Patient information: Implantable cardioverter-defibrillators (The Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?14/31/14834?source=related_link\">",
"      Patient information: Radiofrequency catheter ablation for the heart (Beyond the Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_basics\" href=\"UTD.htm?12/54/13154?source=related_link\">",
"      Patient information: Radiofrequency catheter ablation for the heart (The Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_basics\" href=\"UTD.htm?33/39/34419?source=related_link\">",
"      Patient information: Sudden cardiac arrest (The Basics)",
