" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 535px\">",
"   <div class=\"ttl\">",
"    MRI of neurogenic thoracic outlet syndrome",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 515px; height: 309px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Right brachial plexus magnetic resonance neurography. Coronal and axial T1-weighted images (A, B) and coronal fat-suppressed T2-weighted neurographic image (C) reveal a thick fibrous band (arrows in A and B) causing distortion and edema of the right brachial plexus (arrowheads in A and C). Oblique coronal fat-suppressed T2-weighted neurographic image (D) further illustrates a selective thickening of C8 root (arrowheads).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Luigetti M, Capone F, Di Lazzaro V. Teaching NeuroImages: Neurogenic thoracic outlet syndrome. Neurology 2012; 79:e11. Copyright &copy; 2012 Lippincott Williams &amp; Wilkins.",
