var title_f25_12_25799="Lionfish";
var content_f25_12_25799=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F82853&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F82853&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 480px\">",
"   <div class=\"ttl\">",
"    Lionfish",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 460px; height: 382px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The lionfish is found widely in tropical and temperate oceans. They are frequently kept as pets in home aquariums. Envenomation is painful. Treatment consists of hot water immersion and local wound care.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Photo reproduced with permission from: James W Fatherree, M. Sc. From: Fatherree JW. Lionfish envenomations and the aquarist. Reefkeeping. Available at:",
"     <a href=\"file://www.reefkeeping.com/issues/2002-11/jf/feature/index.php\" target=\"_blank\">",
"      file://www.reefkeeping.com/issues/2002-11/jf/feature/index.php",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
